import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
// import App from './App';
import {BrowserRouter as Router, Switch, Route, Link} from 'react-router-dom';


import img from "./img/img2.jpg";


function Navigation() {
    return (
        <header>
            <Link to={"/"}>Главная</Link>
            <Link to={"/search"}>Поиск книг</Link>
            <Link to={"/all"}>Все книги</Link>
            <Link to={"/top"}>Топ книг</Link>
        </header>
    );
}

function Index() {
    return (
        <div>
            Добро пожаловать!
        </div>
    )
}

function Book(props) {
    return (
        <div class="book">
            <img src={props.img}/>
            <div>{props.name}</div>
            <div>{props.author}</div>
        </div>
    );
}

function BookDisplay(props) {
    return (
        <div class="books">
            {props.books.map(book => <Book {...book}/>)}
        </div>
    )
}

const books = [
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
    {img: img, name: "Как делать фуллстек", author: "Пётр Кулагин"},
];

ReactDOM.render(
    <Router>
        <Navigation/>
        <Switch>
            <Route path="/search">
                Поиск
            </Route>
            <Route path="/all">
                <BookDisplay books={books}/>
            </Route>
            <Route path="/" component={Index}/>
        </Switch>
    </Router>,
    document.getElementById('root')
);
